import styled from "styled-components/native";

export const FirstView2 = styled.View`
flex-direction: row;
align-items: center;
display: flex;
`;

export const BigText2 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 24px;
line-height: 28px;
text-align: center;
color: #C3AD60;
`;

export const SecondView2 = styled.View`
margin-top: 123px;
align-items: center;
justify-content: center;
`;

export const Imagebox = styled.View`
height: 180px;
width: 180px;
background-color: #4E4E4E;
border-color: #808080;
border-style: dashed;
border-width: 1px;
align-items: center;
justify-content: center;
b9order-radius: 20px;
`;
